DROP TABLE IF EXISTS dmy;
CREATE TABLE dmy (
    id          SERIAL PRIMARY KEY,
    lname       VARCHAR(24),
    fname       VARCHAR(24),
    lnamek      VARCHAR(32),
    fnamek      VARCHAR(32),
    email       VARCHAR(128),
    gender      VARCHAR(3),
    age         INTEGER,
    birth       DATE,
    marriage    VARCHAR(3),
    blood       VARCHAR(3),
    pref        VARCHAR(5),
    carrier     VARCHAR(8),
    curry       VARCHAR(32)
);
